import React, { Component } from 'react'
import { connect } from 'react-redux'
import { getProfile } from '../../actions';
import CurrentInfo from './CurrentInfo'
import NavbarProfile from './Navbar_Profile';
import UpdateCurrentInfo from './UpdateCurrentInfo';

export class Profile extends Component {
  constructor(props) {
    super(props);
    this.props.getProfile(this.props.user)
  }
  render() {
    return (
      <div>
        <NavbarProfile/>
        <div className='flex justify-center'><CurrentInfo/></div>
        <UpdateCurrentInfo/>
      </div>
    )
  }
}

const mapStateToProps = (state) => {
    return {
       user: state.riceZoneApp.currentUserID
    }
  };

const mapDispatchToProps = (dispatch) => {
  return {
      getProfile: (user) => dispatch(getProfile(user))
  }
};

export default connect(mapStateToProps, mapDispatchToProps)(Profile)
